import React, { Component } from "react";
import Prism from "prismjs";
import { Grid, Paper, withStyles, List } from "@material-ui/core";

import "../../ReactJs/styles.css";
import Sidebar from "../sidebar";
import PrismCode from "../../ReactJs/prismCode";

const titles = { backgroundColor: "#F0F8FF", padding: "1px", fontSize: "16px" };

const styles = (theme) => ({
  paper: {
    margin: theme.spacing(1),
    padding: theme.spacing(1),
  },
  smMargin: {
    margin: theme.spacing(1),
  },
  actionDiv: {
    textAlign: "center",
  },
});

const evalRPN = `
function policeNotation(tokens) {
  const stack = [];
  for (const tok of tokens) {
    if (!isNaN(tok)) {
      stack.push(parseInt(tok));
    } else {
      const b = stack.pop();
      const a = stack.pop();
      switch (tok) {
        case "+":
          stack.push(a + b);
          break;
        case "*":
          stack.push(a * b);
          break;
        case "-":
          stack.push(a - b);
          break;
        case "/":
          stack.push(a / b);
          break;
      }
    }
  }
  return stack.pop();
}

console.log(policeNotation(["2", "1", "+", "3", "*"]));
`.trim();

const convertToTitle = `
function fun(){
  const arr=["flower","flow","flight"];
  let result = arr[0];

  for(let i=0;i<arr.length;i++){
    while(arr[i].indexOf(result) !==0){
      result = result.substring(0, result.length-1)
    }
  }
  return console.log(result)
}

fun()
`.trim();

const combinationSum3 = `
function fun(){
  const arr=[-1,2,1,-4];
  let sum=0;

  for(let i=0;i<arr.length;i++){
    sum +=arr[i];
  }
  console.log(sum)
}

fun()
`.trim();

const closed3 = `
function fun() {
  const nums = [-1, 3, 2, 5, 10, 4, -2];
  const target = 1;
  let closestSum = 0;
  let closestTriplet = [];

  nums.sort((a,b)=>a-b)
  for (let i = 0; i < nums.length; i++) {
    for (let j = i + 1; j < nums.length; j++) {
      for (let k = j + 1; k < nums.length; k++) {
        const currentSum = nums[i] + nums[j] + nums[k];

        if (Math.abs(currentSum - target) < Math.abs(closestSum - target)) {
          closestSum = currentSum;
          closestTriplet = [nums[i], nums[j], nums[k]];
        }
      }
    }
  }

  console.log(closestTriplet);
}

fun();
`.trim();

const maxSlidingWindow = `
function fun() {
  const arr = {
    '2': ['a', 'b', 'c'],
    '3': ['d', 'e', 'f'],
    '4': ['g', 'h', 'i'],
    '5': ['j', 'k', 'l'],
    '6': ['m', 'n', 'o'],
    '7': ['p', 'q', 'r', 's'],
    '8': ['t', 'u', 'v'],
    '9': ['w', 'x', 'y', 'z'],
  };

  let digits = '23';
  let result = [];

  let newDigits = digits.split('');
  let one = newDigits[0];
  let two = newDigits[1];

  let arrOne = arr[one];
  let arrTwo = arr[two];

  if (arrOne && arrTwo) {
    for (let i = 0; i < arrOne.length; i++) {
      for (let j = 0; j < arrTwo.length; j++) {
        result.push(arrOne[i] + arrTwo[j]);
      }
    }
  }

  console.log(result);
}

fun();
`.trim();

const parenthesis = `
function fun(){
  let left='(';
  let right=')';
  const result=[];

  for(let i=0; i<4; i++){
    if (i % 2 === 0) {
      result.push(left);
    } else {
      result.push(right);
    }
  }

  console.log(result.join('')); 
}

fun();

`.trim();

const generate = `
function fun(n) {
  const result = [];
  const stack = [['', 0, 0]];

  while (stack.length > 0) {
    const [current, open, close] = stack.pop();

    if (current.length === 2 * n) {
      result.push(current);
    } else {
      if (open < n) {
        stack.push([current + '(', open + 1, close]);
      }

      if (close < open) {
        stack.push([current + ')', open, close + 1]);
      }
    }
  }

  return console.log(result);
}

fun(3);
`.trim();

